This torrent contains the Forest visual novel by Liar-Soft translated to English by Amaterasu Translations, as well as their walkthrough, both a &quot;simple&quot; text version, and a more complete PowerPoint document.  The patch is already installed, so all you have to do is extract the 7z file, and run Forest.exe to begin your trip!

Now for a warning, this game IS very trippy, and you may need to play it a few times to fully grasp it so you can feel the full impact.

Enjoy, and please seed!
